import React from 'react';

function Button(props) {
  const { id, name, type, text } = props;

  return (
    <button
      id={ id }
      name={ name }
      type={ type === 'submit' ? 'submit' : 'button' }
    >
      { text }
    </button>
  );
}

Button.propTypes = {
  id: PropTypes.string,
  name: PropTypes.string,
  type: PropTypes.string,
}.isRequired;

export default Button;
